import logo from './logo.svg';
import './App.module.css.css';

function App() {
  return (
    <div>
      <h1 className={classes.heading}>My favorite foods</h1>
      <ul>
        <li>Noodles</li>
        <li>Biryani</li>
        <li>Chicken</li>
      </ul>
    </div>
  );
}

export default App;
